import React from 'react';
import "./Story.css";
import { Avatar } from "@mui/material";

const Story=()=>{
return(
    <>
    <div className="timeline_story">
<Avatar src="https://images.unsplash.com/photo-1565288971009-a6db8844c687?ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHx0b3BpYy1mZWVkfDl8aG1lbnZRaFVteE18fGVufDB8fHx8fA%3D%3D&auto=format&fit=crop&w=600&q=60" className="avatar">R</Avatar>
<p>Tara </p>
</div>
    </>
)
}
export default Story;
